import{_ as l,o as i,c as e,e as r}from"./app.72544fd9.js";const p={},a=r('<h1 id="\u4F9D\u604B\u7684\u5F62\u6210\u8BFB\u4E66\u7B14\u8BB0" tabindex="-1"><a class="header-anchor" href="#\u4F9D\u604B\u7684\u5F62\u6210\u8BFB\u4E66\u7B14\u8BB0" aria-hidden="true">#</a> \u4F9D\u604B\u7684\u5F62\u6210\u8BFB\u4E66\u7B14\u8BB0</h1><h2 id="\u7B2C\u4E00\u90E8\u5206-\u5B69\u5B50\u9700\u8981\u4EC0\u4E48" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E00\u90E8\u5206-\u5B69\u5B50\u9700\u8981\u4EC0\u4E48" aria-hidden="true">#</a> \u7B2C\u4E00\u90E8\u5206 \u5B69\u5B50\u9700\u8981\u4EC0\u4E48</h2><ul><li>\u7B2C\u4E00\u7AE0\uFF1A \u6BCD\u7231\uFF1A \u6700\u574F\u7684\u60C5\u51B5</li></ul><p>\u63D0\u51FA\u5B69\u5B50\u9700\u8981\u6BCD\u7231\u7684\u89C2\u70B9\uFF0C\u54EA\u6015\u662F\u6709\u4E25\u91CD\u7F3A\u9677\u7684\u6BCD\u7231\uFF0C \u4E5F\u6BD4\u6CA1\u6709\u6BCD\u7231\u5F3A</p><ul><li>\u7B2C\u4E8C\u7AE0\uFF1A \u8D70\u8FDB\u9C8D\u5C14\u6BD4\uFF1A\u63A2\u7A76\u5173\u7CFB\u7406\u8BBA</li></ul><p>\u8BB2\u8FF0\u82F1\u56FD\u7CBE\u795E\u5206\u6790\u5B66\u5BB6\u7EA6\u7FF0\xB7\u9C8D\u5C14\u6BD4\u7684\u6838\u5FC3\u7814\u7A76\u65B9\u5411\uFF0C \u7AE5\u5E74\u7ECF\u5386\u4E0E\u4EB2\u5B50\u5173\u7CFB\u5BF9\u4EBA\u683C\u53D1\u5C55\u9020\u6210\u7684\u5F71\u54CD\uFF0C\u5E76\u5F3A\u8C03\u4E86\u5176\u91CD\u8981\u6027</p><ul><li>\u7B2C\u4E09\u7AE0\uFF1A \u9C8D\u5C14\u6BD4\u548C\u514B\u83B1\u56E0\uFF1A\u5E7B\u60F3\u4E0E\u73B0\u5B9E</li></ul><p>\u8BB2\u8FF0\u7EF4\u4E5F\u7EB3\u7CBE\u795E\u5206\u6790\u5E08\u514B\u83B1\u56E0\u7684\u4E3B\u8981\u7814\u7A76\u65B9\u5411\uFF0C\u65E9\u671F\u5FC3\u7406\u8FC7\u7A0B\u7406\u8BBA\uFF0C\u4FA7\u91CD\u4E8E\u5A74\u513F\u5185\u5FC3\u4E16\u754C\u7684\u5E7B\u60F3\uFF0C\u5373\u66F4\u5173\u6CE8\u4E8E\u6BCD\u5A74\u5173\u7CFB\u7684\u7CBE\u795E\u5C42\u9762\uFF0C\u5E76\u5BF9\u9C8D\u5C14\u6BD4\u4EA7\u751F\u4E86\u4E00\u5B9A\u7684\u5F71\u54CD</p><ul><li>\u7B2C\u56DB\u7AE0\uFF1A \u7CBE\u795E\u75C5\u6001\u8005\u7684\u5F62\u6210\uFF1A44\u4E2A\u5C11\u5E74\u72AF</li></ul><p>\u672C\u7AE0\u63D0\u51FA\u5BBD\u5BB9\u7684\u517B\u80B2\u6C1B\u56F4\uFF0C\u5141\u8BB8\u5B69\u5B50\u76F4\u63A5\u8868\u8FBE\uFF0C\u5F15\u5BFC\u53D1\u6CC4\u66F4\u52A0\u6709\u5229\u4E8E\u5B69\u5B50\u5065\u5EB7\u6210\u957F\uFF0C\u5F62\u6210\u81EA\u63A7\u529B\u3002<br> \u5E76\u4EE544\u4E2A\u76D7\u7A83\u5C11\u5E74\u72AF\u7684\u5171\u6027\u7ECF\u5386\u4F5C\u4E3A\u4F8B\u8BC1\uFF0C \u5373\u4ED6\u4EEC\u90FD\u4E0E\u6BCD\u4EB2\u6709\u8FC7\u4E00\u6BB5\u957F\u65F6\u95F4\u7684\u5265\u593A\u5F0F\u5206\u79BB\u7ECF\u5386(\u5373\u5988\u5988\u79BB\u5F00\u4E86\uFF0C\u4F46\u6CA1\u6709\u4EBA\u63A5\u624B\uFF0C\u6216\u8005\u4E0D\u65AD\u5730\u66F4\u6362\u629A\u80B2\u8005)\uFF0C\u6700\u7EC8\u5F62\u6210\u4E86\u60C5\u611F\u7F3A\u4E4F\u4EBA\u683C\uFF0C\u6781\u5EA6\u51B7\u6F20\u7684\u6027\u683C\u3002<br> \u867D\u7136\u8FD9\u4E9B\u7279\u8D28\u5E76\u4E0D\u4E00\u5B9A\u76F4\u63A5\u5BFC\u81F4\u5B69\u5B50\u72AF\u7F6A\uFF0C\u4F46\u5BF9\u7167\u7EC4\u7684\u5FC3\u7406\u5065\u5EB7\u7684\u5C0F\u5B69\u4E00\u5B9A\u6CA1\u6709\u8FD9\u79CD\u7ECF\u5386\u3002<br> \u603B\u4E4B\u65E9\u671F\u5265\u593A\u5F0F\u7684\u5206\u79BB\u6709\u5BB3\uFF0C\u4EE4\u4EBA\u75DB\u82E6\u5E76\u5F71\u54CD\u4EBA\u683C\u7684\u5F62\u6210<br> \u8FD9\u79CD\u89C2\u70B9\u8BA9\u6211\u8054\u60F3\u5230\u4E86\u4E2D\u56FD\u7684\u7559\u5B88\u513F\u7AE5\u7684\u7ECF\u5386</p><ul><li>\u7B2C\u4E94\u7AE0\uFF1A \u6218\u53F7\u5439\u54CD\uFF1A \u4E16\u754C\u536B\u751F\u7EC4\u7EC7\u62A5\u544A</li></ul><p>\u9C8D\u5C14\u6BD4\u5728\u7814\u7A76\u4E2D\u53D1\u73B0\u6BCD\u7231\u5265\u593A\u513F\u7AE5\u8EAB\u4E0A\u76F8\u4F3C\u7684\u75C7\u72B6\uFF1A\u4EBA\u9645\u4EA4\u5F80\u9677\u4E8E\u8868\u9762\uFF0C\u65E0\u6CD5\u5C06\u5FC3\u6BD4\u5FC3\uFF0C\u96BE\u4EE5\u63A5\u8FD1\uFF0C\u7F3A\u4E4F\u60C5\u7EEA\u56DE\u5E94\uFF0C\u7ECF\u5E38\u65E0\u8C13\u7684\u5077\u548C\u9A97\uFF0C\u4E0A\u8BFE\u6CE8\u610F\u529B\u4E0D\u96C6\u4E2D<br> \u9C8D\u5C14\u6BD4\u8BC1\u660E\u4E86\u6BCD\u5A74\u5173\u7CFB\u7684\u6781\u7AEF\u91CD\u8981\u6027\uFF0C\u5B83\u4E0D\u662F\u4E00\u9879\u798F\u5229\uFF0C\u800C\u662F\u4E00\u9879\u7EDD\u5BF9\u7684\u5FC5\u9700\u54C1<br> \u5E76\u63D0\u51FA\u4E86\u5176\u7814\u7A76\u6838\u5FC3\u6BCD\u7231\u548C\u6BCD\u7231\u5265\u593A\u95EE\u9898</p><ul><li>\u7B2C6\u7AE0\uFF1A\u7B2C1\u6218\u573A\u4E24\u5C81\u513F\u7AE5\u5C31\u533B</li></ul><p>\u672C\u7AE0\u4EE5\u513F\u7AE5\u5C31\u533B\u4E3A\u6848\u4F8B\uFF0C\u5F15\u51FA\u4E86\u7F57\u4F2F\u68EE\u5728\u6BCD\u5A74\u5206\u79BB\u95EE\u9898\u4E0A\u7684\u7814\u7A76\u6210\u679C\u53CA\u5176\u7406\u8BBA\u89C2\u70B9\uFF0C\u5E76\u8BA8\u8BBA\u4E86\u8FD9\u4E9B\u7814\u7A76\u5BF9\u9C8D\u5C14\u6BD4\u7406\u8BBA\u7684\u5F71\u54CD\uFF0C\u63D0\u51FA\u6765\u6BCD\u7231\u5728\u5265\u593A\u8FC7\u7A0B\u4E2D\u5B58\u5728\u53CD\u6297\u3001\u7EDD\u671B\u548C\u758F\u79BB\u8FD9\u4E09\u4E2A\u9636\u6BB5\u7684\u7406\u8BBA\u6846\u67B6\u3002</p><ul><li>\u7B2C7\u7AE0\u5C0F\u9E45\u4E0E\u5C0F\u5B69\u4F9D\u604B\u7406\u8BBA\u7684\u8BDE\u751F</li></ul><p>\u9E2D\u5B50\u521A\u5B75\u5316\u65F6\u4F1A\u8FFD\u968F\u7B2C\u4E00\u4E2A\u770B\u5230\u7684\u79FB\u52A8\u7269\u4F53,\u8FD9\u79CD\u73B0\u8C61\u79F0\u4E3A\u201C\u5370\u968F\u201D\u3002\u4F46\u884C\u4E3A\u6A21\u5F0F\u53D7\u73AF\u5883\u5F71\u54CD\uFF0C\u5982\u679C\u5B75\u5316\u540E\u6CA1\u89C1\u5230\u79FB\u52A8\u7269\u4F53\uFF0C\u5219\u884C\u4E3A\u6A21\u5F0F\u4E0D\u4F1A\u53D1\u751F\uFF0C\u6B63\u5E38\u7684\u60C5\u611F\u7EBD\u5E26\u4E0D\u4F1A\u5F62\u6210\u3002</p><p>\u7C7B\u6BD4\u4E4B\u4E0B\uFF0C\u9C8D\u5C14\u6BD4\u5728\u672C\u7AE0\u5F15\u51FA\u4E86\u4F9D\u604B\u7406\u8BBA\uFF0C\u53CD\u9A73\u4E86\u6BCD\u5A74\u60C5\u611F\u7EBD\u5E26\u4EC5\u7531\u5582\u517B\u548C\u629A\u80B2\u5F62\u6210\u7684\u89C2\u70B9\uFF0C\u6B63\u5F0F\u63D0\u51FA\u201C\u4F9D\u604B\u201D\u6765\u63CF\u8FF0\u6BCD\u5A74\u95F4\u7684\u60C5\u611F\u7EBD\u5E26\u3002\u4F9D\u604B\u7C7B\u4F3C\u7231\u604B\uFF0C\u5B69\u5B50\u6E34\u671B\u4EB2\u8FD1\u6BCD\u4EB2\uFF0C\u82E5\u8FD9\u79CD\u6B32\u671B\u5F97\u4E0D\u5230\u6EE1\u8DB3\u6216\u88AB\u4E2D\u65AD\uFF0C\u4F1A\u5BFC\u81F4\u7126\u8651\u548C\u60B2\u75DB\u3002\u4E2A\u4EBA\u8BA4\u4E3A\u4F9D\u604B\u662F\u5BF9\u5B89\u5168\u611F\u548C\u4FE1\u4EFB\u7684\u6E34\u671B\uFF0C\u662F\u5E7C\u5D3D\u751F\u5B58\u672C\u80FD\u7684\u56FA\u6709\u884C\u4E3A\u6A21\u5F0F\u3002</p><p>\u6B64\u5916\uFF0C\u672C\u7AE0\u9C8D\u5C14\u6BD4\u89E3\u91CA\u4E86\u5206\u79BB\u8FC7\u7A0B\u4E2D\u7684\u4E09\u4E2A\u9636\u6BB5\uFF1A\u53CD\u6297\uFF08\u5206\u79BB\u7126\u8651\uFF09\u3001\u7EDD\u671B\uFF08\u54C0\u4F24\uFF09\u3001\u758F\u79BB\uFF08\u9632\u5FA1\uFF09\u3002</p><ul><li>\u7B2C8\u7AE0 \u201C\u7ED9\u9E45\u505A\u4EC0\u4E48\u7CBE\u795E\u5206\u6790\uFF1F\u201D\uFF1A\u6DF7\u4E71\uFF0C\u654C\u5BF9\u4E0E\u4E89\u8BBA</li></ul><p>\u672C\u7AE0\u4E3B\u8981\u8BB2\u8FF0\u4E86\u9C8D\u5C14\u6BD4\u6BCD\u7231\u5265\u593A\u7814\u7A76\u6240\u5F15\u53D1\u7684\u4E89\u8BAE\uFF0C\u9762\u4E34\u7740\u514B\u83B1\u56E0\u5B66\u6D3E\u548C\u5F17\u6D1B\u4F0A\u5FB7\u5B66\u6D3E\u7684\u62A8\u51FB\u3002</p><ul><li>\u7B2C9\u7AE0 \u7334\u5B50\u4E4B\u7231\uFF1A\u6E29\u6696\uFF0C\u5B89\u5168\uFF0C\u6301\u7EED\u6027\u3002</li></ul><p>\u672C\u7AE0\u8BB2\u8FF0\u4E86\u54C8\u6D1B\u7B49\u4EBA\u5BF9\u7334\u5B50\u6BCD\u5A74\u5206\u79BB\u7684\u7814\u7A76\uFF0C\u5176\u7ED3\u679C\u589E\u5F3A\u4E86\u4F9D\u604B\u7406\u8BBA\u7684\u53EF\u4FE1\u5EA6\u3002\u540C\u65F6\u5B89\u65AF\u6C83\u65AF\u6307\u51FA\u6BCD\u7231\u5265\u593A\u6709\u4E09\u4E2A\u7EF4\u5EA6\uFF0C\u5206\u522B\u662F\u6BCD\u7231\u7F3A\u5931\u6BCD\u7231\u626D\u66F2\u6BCD\u7231\u4E2D\u65AD\u3002\u8FD9\u4E9B\u5B66\u8005\u7684\u5B9E\u9A8C\u6216\u8005\u7406\u8BBA\uFF0C\u4F7F\u5F97\u4F9D\u604B\u7406\u8BBA\u66F4\u52A0\u5B8C\u5584\uFF0C\u53EF\u4FE1\u5EA6\u66F4\u9AD8\u3002</p><h2 id="\u7B2C\u4E8C\u90E8\u5206-\u7A81\u7834-\u629A\u517B\u65B9\u5F0F\u5206\u6790" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E8C\u90E8\u5206-\u7A81\u7834-\u629A\u517B\u65B9\u5F0F\u5206\u6790" aria-hidden="true">#</a> \u7B2C\u4E8C\u90E8\u5206 \u7A81\u7834\uFF1A\u629A\u517B\u65B9\u5F0F\u5206\u6790</h2><ul><li>\u7B2C10\u7AE0 \u5B89\u65AF\u6C83\u65AF\u5728\u4E4C\u5E72\u8FBE</li></ul><p>\u672C\u7AE0\u4E3B\u8981\u8BB2\u8FF0\u5B89\u65AF\u6C83\u65AF\u5728\u4E4C\u5E72\u8FBE\u7684\u7814\u7A76\uFF0C\u4ED6\u4ECE\u5B89\u5168\u611F\u51FA\u53D1\uFF0C\u63D0\u51FA\u4E86\u5B89\u5168\u57FA\u5730\u7684\u6982\u5FF5\uFF0C\u52A0\u6DF1\u4E86\u6211\u4EEC\u5BF9\u6BCD\u5A74\u7EBD\u5E26\u548C\u4EBA\u9645\u60C5\u611F\u7EBD\u5E26\u7684\u7406\u89E3\u3002</p><ul><li>\u7B2C11\u7AE0 \u964C\u751F\u60C5\u5883\u5B9E\u9A8C</li></ul><p>\u672C\u7AE0\u8BB2\u8FF0\u4E86\u5B89\u65AF\u6C83\u65AF\u5BF9\u5DF4\u5C14\u7684\u6469\u513F\u7AE5\u7684\u7814\u7A76\u3002\u5DF4\u5C14\u7684\u6469\u513F\u7AE5\u7684\u7814\u7A76\u7ED3\u679C\u4E0E\u7518\u8FBE\u513F\u7AE5\u7684\u7814\u7A76\u6781\u4E3A\u76F8\u4F3C\u3002<br> \u968F\u540E\uFF0C\u5B89\u65AF\u6C83\u65AF\u8BBE\u7F6E\u4E86\u964C\u751F\u60C5\u5883\u5B9E\u9A8C\uFF0C\u901A\u8FC7\u8BE5\u5B9E\u9A8C\uFF0C\u5979\u5C06\u6BCD\u4EB2\u7684\u5173\u7231\u5212\u5206\u4E3A\u56DB\u4E2A\u7EF4\u5EA6\uFF1A<br> \u7B2C\u4E00\uFF0C\u6BCD\u4EB2\u5BF9\u5B69\u5B50\u53D1\u51FA\u7684\u4FE1\u53F7\u6709\u591A\u654F\u611F\uFF1B<br> \u7B2C\u4E8C\uFF0C\u6BCD\u4EB2\u5728\u591A\u5927\u7A0B\u5EA6\u4E0A\u63A5\u7EB3\u548C\u62D2\u7EDD\u5B69\u5B50<br> \u7B2C\u4E09\uFF0C\u5728\u5582\u98DF\u3001\u629A\u89E6\u548C\u966A\u4F34\u65F6\uFF0C\u5979\u662F\u8FC1\u5C31\u5B69\u5B50\u7684\u9700\u6C42\u8FD8\u662F\u66F4\u591A\u5730\u5E72\u6D89\uFF0C\u5F3A\u52A0\u5979\u7684\u4E2A\u4EBA\u610F\u613F\u548C\u65E5\u5E38\u5B89\u6392\uFF1B<br> \u7B2C\u56DB\uFF0C\u5979\u662F\u5426\u6709\u7A7A\u7167\u987E\u5B69\u5B50\uFF0C\u5FFD\u89C6\u5B69\u5B50\u9700\u6C42\u7684\u9891\u7387\u5982\u4F55\u3002</p><p>\u5728\u8FD9\u56DB\u4E2A\u7EF4\u5EA6\u4E0A\uFF0C\u5B89\u5168\u578B\u3001\u77DB\u76FE\u578B\u3001\u56DE\u907F\u578B\u548C\u7126\u8651\u578B\u513F\u7AE5\u7684\u6BCD\u4EB2\u8868\u73B0\u51FA\u663E\u8457\u5DEE\u5F02\u3002<br> \u5B69\u5B50\u80FD\u5426\u5F62\u6210\u5B89\u5168\u578B\u4F9D\u604B\u7684\u5173\u952E\u4E0D\u5728\u4E8E\u6BCD\u7231\u5173\u6000\u7684\u91CF\uFF0C\u800C\u5728\u4E8E\u6BCD\u4EB2\u7684\u6E29\u67D4\u3001\u8D34\u5FC3\u548C\u6280\u5DE7\u3002\u5B89\u5168\u578B\u4F9D\u604B\u513F\u7AE5\u7684\u6BCD\u4EB2\u66F4\u5C11\u8BA9\u5B69\u5B50\u7ECF\u5386\u4E0D\u6109\u5FEB\u7684\u4EB2\u8FD1\u4F53\u9A8C\uFF0C\u5F53\u5B69\u5B50\u60F3\u8981\u6BCD\u4EB2\u62B1\u65F6\uFF0C\u5979\u4EEC\u603B\u662F\u6709\u6C42\u5FC5\u5E94\u3002</p><p>\u7136\u800C\uFF0C\u5B89\u65AF\u6C83\u65AF\u5E76\u4E0D\u6EE1\u8DB3\u4E8E\u7B80\u5355\u7684\u5B89\u5168\u578B\u3001\u77DB\u76FE\u578B\u548C\u56DE\u907F\u578B\u5206\u7C7B\uFF0C\u5979\u8BA4\u4E3A\u8FD9\u4E09\u7C7B\u592A\u8FC7\u7B3C\u7EDF\uFF0C\u4E8E\u662F\u5C06\u4E0D\u5B89\u5168\u5927\u7C7B\u5206\u4E3A\u4E24\u4E2A\u5B50\u7C7B\uFF0C\u5C06\u5B89\u5168\u5927\u7C7B\u5206\u4E3A\u56DB\u4E2A\u5B50\u7C7B\u3002\u8BE6\u7EC6\u5185\u5BB9\u89C1\u5B89\u65AF\u6C83\u65AF\u4E0E\u4EBA\u5408\u8457\u7684\u300A\u4F9D\u604B\u6A21\u5F0F\u300B\u4E00\u4E66\u3002</p><ul><li>\u7B2C12\u7AE0 \u7B2C2\u6218\u573A\uFF1A\u5B89\u65AF\u6C83\u65AF\u7684\u7F8E\u56FD\u9769\u547D</li></ul><p>TODO\uFF1A\u7B2C\u4E00\u6B21\u901A\u8FC7\u542C\u4E66\u6CDB\u8BFB\uFF0C\u503C\u5F97\u4E8C\u6B21\u7CBE\u8BFB\uFF0C\u7CBE\u8BFB\u540E\u518D\u6765\u8865\u5145\u7B14\u8BB0</p><p>\u7C7B\u4F3C\u4E66\u7C4D\u63A8\u8350<a href="#%E5%A4%A9%E7%94%9F%E9%9D%9E%E6%AD%A4">\u5929\u751F\u975E\u6B64</a></p>',32),u=[a];function t(h,c){return i(),e("div",null,u)}const n=l(p,[["render",t],["__file","\u4F9D\u604B\u7684\u5F62\u6210.html.vue"]]);export{n as default};
